import React from "react";
import J_logo from '../Assets/J.png'

const NavigationBar = () => {
    
    return (

        <div>
            <img src={J_logo} alt="None"></img>

            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/aboutme">About Me</a></li>
                <li><a href="/creatorhub">Creator Hub</a></li>
            </ul>
        </div>

    );

}

export default NavigationBar;
